import React from 'react';
import '../Styles/Navbar.css'; // Asegúrate de crear y usar este archivo CSS

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <button className="nav-btn">Inicio</button>
        <button className="nav-btn">Servicios</button>
        <button className="sidebar-btn"><link to = "/" style={{ textDecoration: 'none', color: 'inherit'}}></link>Botón 2</button>

      </div>
    </nav>
  );
};

export default Navbar;
